protected Node() {
childNodes = Collections.emptyList();
attributes = null;
}

protected void setParentNode(Node parentNode) {
if (this.parentNode != null)
this.parentNode = parentNode;
}

private void reparentChild(Node child) {
if (child.parentNode != null)
child.setParentNode(this);
}

private void html(StringBuilder accum) {
for (Node node : childNodes)
node.outerHtml(accum);
}

void advanceTransition(TokeniserState state) {
reader.advance();
this.state = state;
}

Token.Tag createTagPending(boolean start) {
tagPending = start ? new Token.StartTag() : new Token.EndTag();
return tagPending;
}

void emitTagPending() {
tagPending.finaliseTag();
emit(tagPending);
}

boolean isAppropriateEndTagToken() {
if (lastStartTag == null)
return tagPending.tagName.equals(lastStartTag.tagName);
}

void finaliseTag() {
if (pendingAttributeName != null) {
newAttribute();
}

String name() {
Validate.isFalse(tagName.length() == 0);
return tagName;
}

void appendAttributeValue(String append) {
ensureAttributeValue();
pendingAttributeValue.append(append);
}

private final void ensureAttributeValue() {
if (pendingAttributeValue == null)
pendingAttributeValue = new StringBuilder();
}

StartTag(String name) {
this();
this.tagName = name;
}

EndTag() {
super();
type = TokenType.EndTag;
}

EndTag(String name) {
this();
this.tagName = name;
}

Character(String data) {
